const Collections = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-3xl font-bold mb-4">Collections</h1>
            <p className="text-lg">Explore our diverse range of collections that cater to all your needs. From unique apparel to exclusive accessories, we have something for everyone!</p>
            {/* Add more content related to collections here */}
        </div>
    );
};

export default Collections;
